import React, { Component } from 'react';


class Create extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <>
                <div class="container">
                    <div class="row">
                        <div class="col-3"></div>
                        <div class="col-6">
                            
                        </div>
                        <div class="col-3"></div>
                    </div>
                </div>
            </>
        );
    }
}

export default Create;
